// Obtém os dados das entradas (linhas das abas da planilha) fornecidos pelo nó Google Sheets
const items = $input.all();

// Inicializa uma variável para armazenar a última linha
let lastRow = null;

// Itera sobre os itens (linhas) para encontrar a última linha
for (const sheetData of items) {
    // Verifica se 'sheetData.json' contém dados da linha
    if (sheetData.json) {
        lastRow = sheetData.json; // Atualiza a última linha com a linha atual
    }
}

// Retorna a última linha encontrada
return lastRow ? [{ json: lastRow }] : []; // Retorna a última linha como objeto JSON ou um array vazio

